messages__text:
Невозможно перечислить все зверства и издевательства карателей над протестующими. Мы выбрали 10 фактов жестокого и недопустимого обращения с людьми. Вот чем занимаются «невиновные» каратели.

1. Изнасилование мужчины резиновой дубинкой;
2. Силовики наступали на сломанную ногу и пинали по ней;
3. Разрезали сзади шорты и угрожали, что засунут в задний проход гранату;
4. Переломы, выбитые зубы, рассечения мягких тканей и ожоги от электрошокера, а также черепно-мозговые травмы различной степени тяжести;
5. Избивали кулаками, ногами и дубинками, часами заставляли стоять, находиться на коленях или лежать в стрессовых позах и сутками держали в переполненных сверх всякой меры камерах;
6. Журналист из Гродно предъявил свою пресс-карту, но его все равно забрали, и при этом омоновец сломал ему оба запястья;
7. Омоновец выстрелил в упор в человека резиновой пулей и потребовалась операция, чтобы извлечь пулю из легких;
8. У человека, оставленного без инсулина на момент перевода в больницу наступила клиническая смерть;
9. Задержанному омоновцы отрезали дреды;
10. Поставили на колени лицом к спине следующего задержанного и стянули руки сзади пластиковой стяжкой. Стяжка была настолько тугая, что кровоточили запястья.
